import { BrowserRouter as Router, Routes, Route, useLocation } from 'react-router-dom';
//components
// import Grid from "./Grid";
import Header from "./Header";
// import Playlist from "./Playlist";


//hooks

const Home = () => {


  return (
    <>
      <Header /> 
      <Router>
        <Routes>
        <Route path="/search">
            <h1>Search</h1>
          </Route>
          <Route path="/playlists/:id">
            <h1>Playlists</h1>
          </Route>
          <Route path="/">
            <h1>Home</h1>
          </Route>
        </Routes>
      </Router>

    </>
  );
};

export default Home;
